                <textarea value={this.props.bc} onChange={this.onChange}/>
                <textarea value={this.props.ca} onChange={this.onChange}/>
                <textarea value={this.props.cb} onChange={this.onChange}/>
                <textarea value={this.props.cc} onChange={this.onChange}/>
            </div>

        );
    }
};

export default MandalArtTable;
